import React from 'react';
import Navbar from '../components/common/navbar'; // 임시
import Main from '../components/board/main';
import Footer from '../components/common/footer'; // 임시

import DeadlineTag from '../components/common/deadlineTag'; // 일단 레이아웃 용으로 위치만 잡겠습니다..
import styled from 'styled-components';

const Temp = styled.img`
  left: 726px;
  top: 762px;
`;

const Board = () => {
  return (
    <>
                <Temp>
                  <DeadlineTag />
                </Temp>
      <Navbar />
      <Main />
      <Footer />
    </>
  )
};

export default Board;
